// Footer.jsx

import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEnvelope, faFacebookSquare, faInstagram, faWhatsappSquare } from '@fortawesome/free-brands-svg-icons';
// import './Footer.css';

function Footer() {
  return (
    <footer className="bg-red text-white py-3">
      <div className="container d-flex align-items-center justify-content-center">
        <a href="mailto:consultas@loquemasticatumascota.com.ar" className="mr-2 text-white">
          <FontAwesomeIcon icon={faEnvelope} />
        </a>
        <span className="mr-2">&copy; 2023 Lo que Mastica tu Mascota</span>
        <a href="#" className="mr-2 text-white">
          <FontAwesomeIcon icon={faFacebookSquare} />
        </a>
        <a href="#" className="mr-2 text-white">
          <FontAwesomeIcon icon={faInstagram} />
        </a>
        <a href="#" className="text-white">
          <FontAwesomeIcon icon={faWhatsappSquare} />
        </a>
      </div>
    </footer>
  );
}

export default Footer;
